import React, { Component} from 'react';
import axios from 'axios';


const props = { condicion: "1" }


export default class Servicios extends Component {
    state = {
        prop: []
    }

    componentDidMount() {
        axios.get('http://localhost:3001/propiedades')
            .then(res => {
                const prop = res.data;
                this.setState({ prop });
            })
    }


    render() {
        return (
            <div>
                { this.state.prop.map(post => {
                    if (post.category == 1) {
                        return (<><h3 key={post.id}>{post.tittle}</h3>
                            <li>{post.region}</li></>)

                    }
                })
                }
            </div>
        )
    }
}
